import Home from "./components/Home";
import CountryCodesPage from "./components/CountryCodesPage";
import UserQueryForm from "./components/UserQueryForm";
import Signup from "./components/Signup";
import NewMap from "./components/NewMap";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" exact element={<Home />} />
        <Route path="/shop" exact element={<CountryCodesPage />} />
        <Route path="/about" exact element={<UserQueryForm />} />
        <Route path="/contact" exact element={<Signup />} />
        <Route path="/map" exact element={<NewMap />} />
        <Route path="/sendotp" exact element={<OTPGenerator />} />
      </Routes>
    </Router>
  );
}

export default App;
